import React from 'react';
import { useParams } from 'react-router-dom';

const Project = ({}) => {
    const { project } = useParams();

    return (
        <div className='main-project'>
            <h1 className="main-project__title title">Project title</h1>
        </div>
    );
}

export default Project;
